import React from "react";
import { MDBFooter, MDBBtn, MDBIcon } from "mdbreact";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import { faCoffee, faX } from "@fortawesome/free-solid-svg-icons";
import { Button } from "react-bootstrap";

const Footer = () => {
  return (
    <footer className=" fixed-bottom shadow flexible-navbar bg-info text-light">
      <div className="pb-2 ml-3 mt-3">
        <FontAwesomeIcon icon={faCoffee} className="mr-3" />
        <MDBIcon fab icon="twitter" className="mr-3" />
        <MDBIcon fab icon="youtube" className="mr-3" />
      </div>
      <p className="footer-copyright mb-0 py-3 text-right mr-3">
        &copy; {new Date().getFullYear()} Copyright:{" "}
        <a href="https://www.MDBootstrap.com"> Amirreza Ghanei </a>
      </p>
    </footer>
  );
};

export default Footer;
